insert into Vivienda (id, avatar, codigo_postal, descripcion, direccion, latlng, metros_cuadrados, num_banios, num_habitaciones, poblacion, precio, provincia, tiene_ascensor, tiene_garaje, tiene_piscina, tipo_vivienda, titulo, inmobiliaria, user_entity_id) values (NEXTVAL('hibernate_sequence'), 'https://i.pinimg.com/originals/12/de/c0/12dec07702f57144f57a6e7ecc98da02.jpg', 41010, 'Vivienda a estrenar después de una reforma integral en la mejor zona del casco histórico. En pleno barrio del arenal.Lo convierte es una magnifica opción tanto para vivir como para invertir se encuentra en una primera planta y es exterior con dos balcones a la calle.', '868 Talmadge Court', '-58.7226377,-34.4765431', 290, 3, 1, 'Espartinas', 504754, 'Sevilla', false, true, false, 'ALQUILER', 'Arenal', 1, '45bcc33a4e9111ec81d30242ac130003');
insert into Vivienda (id, avatar, codigo_postal, descripcion, direccion, latlng, metros_cuadrados, num_banios, num_habitaciones, poblacion, precio, provincia, tiene_ascensor, tiene_garaje, tiene_piscina, tipo_vivienda, titulo, inmobiliaria, user_entity_id) values (NEXTVAL('hibernate_sequence'), 'https://i.pinimg.com/originals/12/de/c0/12dec07702f57144f57a6e7ecc98da02.jpg', 41010, 'Casa de 584 m² en Sevilla.Provincia de Sevilla. La amplitud de esta vivienda proporciona a una familia con niños todo el espacio que necesita.', '27391 Anderson Circle', '38.131876,-6.7575785', 411, 6, 4, 'Triana', 861193, 'Sevilla', false, true, false, 'VENTA', 'Ático en venta en Arenal', 2, '9d003bdd161b4547ba62e2c2fde29f87');
insert into Vivienda (id, avatar, codigo_postal, descripcion, direccion, latlng, metros_cuadrados, num_banios, num_habitaciones, poblacion, precio, provincia, tiene_ascensor, tiene_garaje, tiene_piscina, tipo_vivienda, titulo, inmobiliaria, user_entity_id) values (NEXTVAL('hibernate_sequence'), 'https://i.pinimg.com/originals/12/de/c0/12dec07702f57144f57a6e7ecc98da02.jpg', 41010, 'Viviendas de líneas rectas y modernas, muy luminosas, con un diseño exquisito, donde ha primado el espacio, el confort y el bienestar, pensadas para encajar con el entorno que les rodea. Cada vivienda contará con parcela privada que oscilará (según vivienda) entre los 165,75 m2 y los 340,30 m2, con una superficie construida de 106 m2 construidos, distribuidos en 3 dormitorios, baño, aseo (ducha opcional), salón-comedor, cocina independiente, terraza y porche. Entre las calidades destacamos la pre-instalación de aire acondicionado y de alarma y su eficiencia energética.', '696 Sundown Trail', '27.1255402,43.3625303', 384, 3, 3, 'Bormujos', 366434, 'Sevilla', true, true, false, 'OBRANUEVA', 'Casa o chalet en venta en calle Gravina', 3, '778418b44e9111ec81d30242ac130003');
insert into Vivienda (id, avatar, codigo_postal, descripcion, direccion, latlng, metros_cuadrados, num_banios, num_habitaciones, poblacion, precio, provincia, tiene_ascensor, tiene_garaje, tiene_piscina, tipo_vivienda, titulo, inmobiliaria, user_entity_id) values (NEXTVAL('hibernate_sequence'), 'https://i.pinimg.com/originals/c5/05/3e/c5053ef961cd25837d37a3b15019cf77.png', 41010, 'La casa se compone de sótano, planta principal, primera y segunda planta.En la planta sótano nos encontramos una sala de 25m2, una gran zona de lavadero y un garaje para 3 coches. En la planta principal se sitúa la cocina, que tiene salida directa a la zona de barbacoa, porche y piscina, y un amplio salón comedor con suelos de mármol. La carpintería de la casa es en su gran parte de madera de carácter colonial, a excepción de la cocina y los cuartos de baño que son de aluminio.', '33 Oneill Crossing', '54.9809527,51.1625615', 179, 6, 4, 'Gelves', 785240, 'Sevilla', false, true, false, 'OBRANUEVA', 'Ático en venta en Arenal', 4, '8b9438744e9211ec81d30242ac130003');
